import PropTypes from 'prop-types'

/*Criamos um component Item para reaproveitarmos como fragment */
function Item({marca, ano_lancamento}){
    return(
        <>
        <li>{marca}</li>
        </>
    )
}

Item.propTypes = {
    marca: PropTypes.string.isRequired,
    ano_lancamento: PropTypes.number
}

Item.defaultProps = {
    
}

export default Item
